define(["templates/competitions"],function(e){return Vue.extend({template:e["edit-phase"],data:function(){return{name:"",showDelete:!0}},methods:{handleKeyDown:function(e){13===e.keyCode&&this.confirm()},confirm:function(){0<this.name.length&&this.$emit("close",this.name)},cancel:function(){this.$emit("close")},deletePhase:function(){this.$emit("close",{action:"delete"})}},mounted:function(){window.setTimeout(function(){$("#txtPhaseName").focus()},500)}})});